import { createRouter, createWebHistory } from "vue-router";

const router = createRouter({
  history: createWebHistory(),
  routes: [
    {
      path: "/login",
      component: () => import("../components/AppLogin.vue"),
      name: "login",
    },
    {
      path: "/applications",
      component: () => import("../pages/AppApplications.vue"),
      name: "applications",
    },
    {
      path: "/users",
      component: () => import("../pages/AppUsers.vue"),
      name: "users",
    },
    {
      path: "/user",
      component: () => import("../pages/AppUser.vue"),
      name: "user",
    },
    {
      path: "/worker",
      component: () => import("../pages/user/AppWorker.vue"),
      name: "worker",
    },
    {
      path: "/staff",
      component: () => import("../pages/AppStaff.vue"),
      name: "staff",
    },
    {
      path: "/employee",
      component: () => import("../pages/AppEmployee.vue"),
      name: "employee",
    },
    {
      path: "/tickets",
      component: () => import("../pages/AppTickets.vue"),
      name: "tickets",
    },
    {
      path: "/feedback",
      component: () => import("../pages/FeedBack.vue"),
      name: "feedback",
    },
  ],
});

export default router;
